import React from 'react';
import PropTypes from 'prop-types';
import SuggestionItem from './SuggestionItem';

const SuggestionList = ({ isFocused, searchTerm, planets, isLoading, isError, handleSelectPlanet }) => {
  return (
    isFocused && searchTerm.length > 0 && (
      <ul className="autocomplete-list">
        {isLoading && <li>Loading...</li>}
        {isError && <li>Error loading suggestions</li>}
        {!isLoading && !isError && planets.length === 0 && <li>No planets found</li>}
        {planets.map((planet) => (
          <SuggestionItem key={planet.name} planet={planet} handleSelectPlanet={handleSelectPlanet} />
        ))}
      </ul>
    )
  );
};

// PropTypes validation
SuggestionList.propTypes = {
  isFocused: PropTypes.bool.isRequired,
  searchTerm: PropTypes.string.isRequired,
  planets: PropTypes.arrayOf(PropTypes.shape({
    name: PropTypes.string.isRequired
  })),
  isLoading: PropTypes.bool.isRequired,
  isError: PropTypes.bool.isRequired,
  handleSelectPlanet: PropTypes.func.isRequired,
};

export default SuggestionList;
